INSERT INTO `buzztro_blogs` (`sr_Id`, `blog_id`, `blog_title`, `blog_img`, `blog_url`, `blog_desc`, `datetime`) VALUES
(1, 'str_1', 'The Top 8 Ways to Break Into the Development Field and Get Hired.', '5e60fbf0bcad51.png', 'http://www.pranaydas.in', '1. Self-Learning<br />\r\nThis is perhaps the most important and crucial point among all. Self-learning enables you to learn what you want, when you want, and how you want. Self-learning tends to be more effective than instructional learning. There are many online sites which provide free tutorials and free resources to learn new programming languages.<br />\r\n<br />\r\nSome of these free websites are mentioned below.<br />\r\n<br />\r\n• CodeCademy<br />\r\n<br />\r\n• Free Code Camp<br />\r\n<br />\r\n• Code Signal<br />\r\n<br />\r\n• Khan Academy<br />\r\n<br />\r\n• YouTube (Surprising but true!)<br />\r\n<br />\r\nAccording to 2018\'s StackOverflow Survey, more than 86% of programmers taught themselves coding.<br />\r\n<br />\r\n2. Online Resources<br />\r\nMany programmers on YouTube and other platforms who make tutorial videos always leave a link to their project\'s source code in the description box. Make use of these free resources to practice and level up your knowledge. 90% of programmers share their source code for free which is why the programming community is known the most generous community of all.<br />\r\n<br />\r\nSome of the free websites where programmers share their source codes are mentioned below.<br />\r\n<br />\r\n• Codepen<br />\r\n<br />\r\n• GitHub<br />\r\n<br />\r\n• JS Fiddle<br />\r\n<br />\r\n• YouTube (Again, surprising but true!)<br />\r\n<br />\r\nYou Don\'t Need to Know Everything<br />\r\nIf you are thinking that you won\'t get a job because you don\'t know how to program everything then you\'re getting it all wrong. Every successful programmer learns only about 30% of coding and gets to 100% with practice and perseverance.<br />\r\n<br />\r\nOne can never finish learning programming. This is because everything in the programming field gets updated periodically, including frameworks and different libraries. There are new or updated JavaScript libraries released every day. You don\'t need to know everything but most importantly, stay updated and go with the flow.<br />\r\n<br />\r\n3. Remain Self-Motivated<br />\r\nSelf-taught programmers have more options to dive deeply into the coding world by staying motivated and doing challenges. There are many challenges for programmers on Instagram, one of which is \"The 30-day JavaScript Challenge.\"<br />\r\n<br />\r\nSome of the free websites to take on online free challenges are mentioned below.<br />\r\n<br />\r\n• Coderbyte (They also have filtered challenges based on companies like Google, Facebook, Microsoft, etc.)<br />\r\n<br />\r\n• CodeEval<br />\r\n<br />\r\n4. Start With JavaScript, Python or pHp<br />\r\nJavaScript, Python, and pHp are the most common and basic languages that every programmer should have a working knowledge of. These languages are currently the most popular languages with JavaScript being on the top. Every website makes at least some use of one of these languages because they have the ability to manipulate the existing code. These languages are used widely when developing dynamic websites.<br />\r\n<br />\r\nThere are many free Udemy courses and YouTube tutorials to learn these languages, from beginner to advanced.<br />\r\n<br />\r\n5. Make Use of StackOverflow & GitHub<br />\r\nBuild a profile on GitHub and submit small projects and contribute to open source projects. Use StackOverflow to resolve coding issues. StackOverflow is a place where you can easily find the solution to fix your error. Also, you can contribute by giving solutions to the problems asked by other programmers.<br />\r\n<br />\r\nVisit my GitHub profile: Pranay\'s GitHub<br />\r\n<br />\r\n6. Build a Digital Portfolio<br />\r\nBuy a domain and set up a website that features yourself and your works. The main aim of your portfolio should be that any visitor visiting your website should get enough idea about you and what kind of work are you interested in. A portfolio is a living and changing collection of records that reflect your accomplishments, skills, experiences, and attributes. It showcases samples of some of your best work and achievements.<br />\r\n<br />\r\n7. Attend Webinars, Workshops, and Seminars<br />\r\nStart exploring the programming world by attending events and seminars. Try attending workshops, webinars, and interviews that will help you build and improve your confidence level and help you get hired. You get to meet a lot of great, like-minded programmers. Also, this will help you gain more knowledge about programming. It helps you to gain motivation and re-energizing personally.<br />\r\n<br />\r\n8. Freelancing<br />\r\nLastly, after gaining enough knowledge, start freelancing. This will help you gain experience on real projects and also encounter new problems and errors, but don\'t worry; StackOverflow is still up and running. Freelancing will help you promote yourself and increase your audience reach. After gaining experience from about 6-8 months of freelancing, your chance for getting hired and working in an organizational level becomes high.', '2020-03-05 18:47:36'),
